import { StyleSheet } from 'react-native';

export default StyleSheet.create(
    {
        nome:{
            fontWeight: 'bold',
            fontSize: '1.25rem'
        },
        notaLoja:{
            color: '#fff',
            fontWeight: 'bold',
            fontSize: '1.1rem'
        },
        star:{
            width: '25px',
            height: '25px',
            marginLeft: '10px'
        },
        nota:{
            flexDirection: 'row',
        }
        
    }
);
